import './App.css';
import { useState, useEffect } from "react";

function App() {
  const [date, setDate] = useState("");

  useEffect(() => {
    console.log(date);
  }, [date])

  return (
    <div className="App">
      <h1>Freshman Zero</h1>
      <label for="date">Date:</label>
      <input type="date" id="date" name="date" value={date} onChange={e => setDate(e.target.value)}/>
    </div>
  );
}

export default App;
